function [v,w,sigma2]=scalarGaussMixMomentFitting(x,N,inputType)
%%SCALARGAUSSMIXMOMENTFITTING Given either raw samples of a scalar 
%           continuous distribution or the central moments of the
%           distribution, fit a Gaussian mixture distribution of 2 to 5
%           components to the data. The mixture distribution is such that
%           all components have the same variance. This works well with
%           distributions with finite moments when enough samples are
%           given. The result of this can be used on its own, or to
%           initialize an EM algorithm for ML fitting.
%
%INPUTS: x This is either a length numSamples set of samples of the
%          distribution to fit or a length 2*N=1 vector such that x(1)=1,
%          x(2) is the mean of the distribution, x(3) is the variance of
%          the distribution, and x(n+1) is the nth central moment of the
%          distribution (obtained, for example, using the
%          unbiasedMomentCumulant function from samples).
%        N The number of components in the distribution. This can be form 2
%          to 5.
% inputType This specified whether samples are moments are given. Possible
%          values are:
%          0 (The default if omitted or an empty matrix is passed) Assume
%            that x is random samples of the distribution.
%          1 Assume that x is central moments of the distribution.
%
%OUTPUTS: v A 1XN set of means of the Gaussian mixture distribution.
%         w An NX1 set of weights for the Gaussian mixture distribution.
%           These sum to 1.
%    sigma2 The common variance for all N Gaussian components in the
%           mixture.
%
%The algorithm used is presented in [1]. However, the steps for the scalar
%portion in [2] are easier to follow. The polynomials from the matrix
%determinants to obtain sigma are where precalculated from the second to
%the fifth order (which has a great many terms). For finding the means of
%the individual Gaussian as well as the mixture weights, the m_k moments in
%Section 6 of [2] are computed and then rather than evaluating the means
%and weights directly via matrix manipulation, since the means and weights
%are actually quadrature points and weights, the moments23TermRecur
%function is used with the m_k moments to get the 3-term recursion needed
%to obtain the cubature points and weights directly from the
%orthoPolyZerosFromRecur function.
%
%EXAMPLE 1:
%This is an example of a two-component mixture. Samples are passed to the
%function and it returns estimates of the common variance between the
%components, sigma2, the means v and the weights w that are in the general
%vicinity of the true values.
% w=[0.25,0.75];
% sigma2=reshape([4,4],[1,1,2]);
% v=[-1,2];
% N=length(v);%# of components in the mixture.
% numMC=1e6;
% x=GaussianMixtureD.rand(numMC,w,v,sigma2);
% [vEst,wEst,sigma2Est]=scalarGaussMixMomentFitting(x,N)
%
%EXAMPLE 2:
%This is the same as example 1, but with a 3 component mixture. Again, the
%function recreates the mixture reasonably well when given many random
%samples.
% w=[0.25,0.5,0.25];
% sigma2=reshape([4,4,4],[1,1,3]);
% v=[-1,2,7];
% N=length(v);%# of components in the mixture.
% numMC=1e6;
% x=GaussianMixtureD.randS(numMC,w,v,sigma2);
% [vEst,wEst,sigma2Est]=scalarGaussMixMomentFitting(x,N)
%
%EXAMPLE 3:
%This is like the first two examples, but now there are four components. A
%larger number of samples is needed to obtain reasonably good agreenment
%between the truth and the estimated quantities.
% w=[0.2,0.4,0.3,0.1];
% sigma2=reshape([4,4,4,4],[1,1,4]);
% v=[-4,2,7,-2];
% N=length(v);%# of components in the mixture.
% numMC=1e7;
% x=GaussianMixtureD.rand(numMC,w,v,sigma2);
% [vEst,wEst,sigma2Est]=scalarGaussMixMomentFitting(x,N)
%
%EXAMPLE 4:
%This is a five component example, which also needs a large number of
%samples to obtain good agreement with the true distribution.
% w=[0.2,0.3,0.3,0.1,0.1];
% sigma2=reshape([4,4,4,4,4],[1,1,5]);
% v=[-4,2,7,-2,10];
% N=length(v);%# of components in the mixture.
% numMC=1e7;
% x=GaussianMixtureD.rand(numMC,w,v,sigma2);
% [vEst,wEst,sigma2Est]=scalarGaussMixMomentFitting(x,N)
%
%REFERENCES:
%[1] B. G. Lindsay, "Moment matrices: Applications in mixtures," The
%    Annals of Statistics, vol. 17, no. 2, pp. 722-740, 1989.
%[2] B. G. Lindsay and P. Basak, "Multivariate normal mixtures: A fast
%    consistent method of moments," Journal of the American Statistical
%    Association, vol. 88, no. 422, pp. 468-476, Jun. 1993.
%
%January 2021 David F. Crouse, Naval Research Laboratory, Washington D.C.
%(UNCLASSIFIED) DISTRIBUTION STATEMENT A. Approved for public release

if(nargin<3||isempty(inputType))
    inputType=0;
end

if(N~=fix(N)&&N>1)
    error('The length of g must be an odd integer greater than 1.')
end

if(inputType==0)
    %If raw samples were provided.
    %Get CENTRAL moments.
    g=zeros(2*N+1,1);
    g(1)=1;
    for k=1:(2*N)
        g(k+1)=unbiasedMomentCumulant(x(:),k,true);
    end
else
    g=x;
    if(length(g)~=2*N+1)
        error('The length of g is inconsistent with N.')
    end
end
meanVal=g(2);
%Setting this to 0 centers the moments. The mean will be added back in the
%end.
g(2)=0;

switch(N)
    case 2
        sigma2=twoElements(g);
    case 3
        sigma2=threeElements(g);
    case 4
        sigma2=fourElements(g);
    case 5
        sigma2=fiveElements(g);
    otherwise
    error('The number of Gaussians in the mixture implied by the length of g is not supported.');
end

mk=getAllm(g,sigma2);

[alpha,beta]=moments23TermRecur(mk);
[v,w]=orthoPolyZerosFromRecur(N,alpha,beta,[],mk(1));

v=v+meanVal;

end

function mk=getAllm(g,sigma)
%%GETALLM
    N=(length(g)-1)/2;
    mk=zeros(2*N+1,1);
    for k=0:(2*N)
        sumVal=0;
        for m=0:k
            if(mod(k-m,2)==0)
                sumVal=sumVal+binomial(k,m)*(-1j)^(k-m)*g(m+1)*doubleFactorial(k-m-1)*sigma^((k-m)/2);
            end
        end
        mk(k+1)=sumVal;
    end
end

function r=twoElements(g)
    c0=-g(3)^3-g(1)*g(4)^2-g(2)^2*g(5)+g(3)*(2*g(2)*g(4)+g(1)*g(5));
    c1=-g(1)*(3*g(3)^2-4*g(2)*g(4)+g(1)*g(5));
    c2=6*g(1)*(-g(2)^2+g(1)*g(3));
    c3=-2*g(1)^3;
    
    r=roots([c3;c2;c1;c0]);
    r=r(imag(r)==0);
    r1=r(r>0);
    %This shouldn't be empty unless there are finite precision error and
    %rather bad distributions. This is just an ad-hoc fix for very bad
    %scenarios.
    if(isempty(r1))
        r1=abs(r);
    end
    r=min(r1);
end

function r=threeElements(g)
    c0=g(4)^4+g(3)^2*g(5)^2-g(1)*g(5)^3-2*g(2)*g(3)*g(5)*g(6)+g(2)^2*g(6)^2-g(1)*g(3)*g(6)^2-(g(3)^3+(g(2)^2-g(1)*g(3))*g(5))*g(7)-g(4)^2*(3*g(3)*g(5)+2*g(2)*g(6)+g(1)*g(7))+2*g(4)*((g(3)^2+g(1)*g(5))*g(6)+g(2)*(g(5)^2+g(3)*g(7)));
    c1=3*g(3)^3*g(5)+g(2)^2*(9*g(5)^2-8*g(4)*g(6))+g(3)*(-16*g(2)*g(4)*g(5)+g(1)*(g(5)^2+4*g(4)*g(6)))+g(3)^2*(-2*g(4)^2+6*g(2)*g(6)-3*g(1)*g(7))+4*g(2)*(2*g(4)^3-g(1)*g(5)*g(6)+g(1)*g(4)*g(7))+g(1)*(g(1)*g(6)^2-g(5)*(2*g(4)^2+g(1)*g(7)));
    c2=-9*g(3)^4+4*g(1)*g(2)*g(4)*g(5)+12*g(3)^2*(2*g(2)*g(4)+g(1)*g(5))+12*g(2)^3*g(6)+g(1)^2*(7*g(5)^2-12*g(4)*g(6))+g(2)^2*(4*g(4)^2-6*g(1)*g(7))+6*g(3)*(-2*g(1)*g(4)^2-5*g(2)^2*g(5)+g(1)^2*g(7));
    c3=-48*g(2)^3*g(4)+36*g(2)^2*(g(3)^2+g(1)*g(5))+12*g(1)^2*g(2)*g(6)-2*g(1)*(6*g(3)^3+33*g(1)*g(3)*g(5)+g(1)*(-22*g(4)^2+g(1)*g(7)));
    c4=12*(3*g(2)^4-6*g(1)*g(2)^2*g(3)-8*g(1)^2*g(2)*g(4)+g(1)^2*(9*g(3)^2+2*g(1)*g(5)));
    c5=72*g(1)^2*(g(2)^2-g(1)*g(3));
    c6=12*g(1)^4;
    
    r=roots([c6;c5;c4;c3;c2;c1;c0]);
    r=r(imag(r)==0);
    r1=r(r>0);
    %This shouldn't be empty unless there are finite precision error and
    %rather bad distributions. This is just an ad-hoc fix for very bad
    %scenarios.
    if(isempty(r1))
        r1=abs(r);
    end
    r=min(r1);
end

function r=fourElements(g)

    c0=g(5)^5+g(1)*g(6)^4-2*g(4)^3*g(6)*g(7)+2*g(2)*g(4)*g(6)^2*g(7)+2*g(1)*g(4)*g(6)*g(7)^2+g(2)^2*g(7)^3-2*g(1)*g(4)*g(6)^2*g(8)+2*g(2)*g(4)^2*g(7)*g(8)-2*g(2)^2*g(6)*g(7)*g(8)+g(1)*g(4)^2*g(8)^2+((g(4)^2-g(2)*g(6))^2-g(1)*g(4)^2*g(7))*g(9)-g(5)^3*(4*g(4)*g(6)+3*g(3)*g(7)+2*g(2)*g(8)+g(1)*g(9))+g(5)^2*(3*g(3)*g(6)^2+3*g(4)^2*g(7)+4*g(2)*g(6)*g(7)+g(1)*g(7)^2+4*g(3)*g(4)*g(8)+2*g(1)*g(6)*g(8)+(g(3)^2+2*g(2)*g(4))*g(9))+g(3)^2*(g(7)*(g(6)^2-2*g(4)*g(8))+2*g(4)*g(6)*g(9))+g(3)^3*(g(8)^2-g(7)*g(9))+g(5)*(-3*g(1)*g(6)^2*g(7)+2*g(3)^2*g(7)^2-2*g(4)^3*g(8)-4*g(3)^2*g(6)*g(8)-g(1)*g(3)*g(8)^2+g(1)*g(3)*g(7)*g(9)+3*g(4)^2*(g(6)^2-g(3)*g(9))+2*g(4)*(-g(7)*(g(3)*g(6)+2*g(2)*g(7)+g(1)*g(8))+g(1)*g(6)*g(9))-2*g(2)*(g(6)^3-g(3)*g(7)*g(8)+g(3)*g(6)*g(9))+g(2)^2*(g(8)^2-g(7)*g(9)))+g(3)*(2*g(2)*g(6)*(-g(7)^2+g(6)*g(8))+g(4)^2*(g(7)^2+2*g(6)*g(8))-g(1)*(g(7)^3-2*g(6)*g(7)*g(8)+g(6)^2*g(9))-2*g(4)*(g(6)^3+g(2)*(g(8)^2-g(7)*g(9))));
    c1=-6*g(2)*g(5)^3*g(6)-8*g(4)^4*g(7)+g(1)*g(5)^3*g(7)+8*g(2)^2*g(6)^2*g(7)-5*g(2)^2*g(5)*g(7)^2-4*g(1)*g(2)*g(6)*g(7)^2+g(1)^2*g(7)^3-12*g(2)^2*g(5)*g(6)*g(8)+4*g(1)*g(2)*g(6)^2*g(8)+4*g(1)*g(2)*g(5)*g(7)*g(8)-2*g(1)^2*g(6)*g(7)*g(8)+g(1)^2*g(5)*g(8)^2+9*g(2)^2*g(5)^2*g(9)-4*g(1)*g(2)*g(5)*g(6)*g(9)+g(1)^2*g(6)^2*g(9)-g(1)^2*g(5)*g(7)*g(9)+4*g(4)^3*(3*g(5)*g(6)-2*g(3)*g(8)+2*g(2)*g(9))+g(3)^3*(16*g(7)^2-18*g(6)*g(8)+3*g(5)*g(9))+g(3)*(15*g(5)^4+2*g(6)^2*(-12*g(2)*g(6)+g(1)*g(7))+g(5)*(32*g(2)*g(6)*g(7)+g(1)*(g(7)^2-4*g(6)*g(8)))+g(5)^2*(-6*g(2)*g(8)+g(1)*g(9)))-g(4)^2*(5*g(5)^3+8*g(2)*g(6)*g(7)-7*g(1)*g(7)^2+4*g(1)*g(6)*g(8)+2*g(3)^2*g(9)+2*g(5)*(-19*g(3)*g(7)+6*g(2)*g(8)+g(1)*g(9)))+g(3)^2*(33*g(5)*g(6)^2-34*g(5)^2*g(7)+g(2)*(-6*g(7)*g(8)+6*g(6)*g(9))+3*g(1)*(g(8)^2-g(7)*g(9)))+2*g(4)*(11*g(3)^2*(-g(6)*g(7)+g(5)*g(8))+g(1)*(2*g(6)^3-6*g(5)*g(6)*g(7)+3*g(5)^2*g(8))+4*g(2)^2*(g(7)*g(8)-g(6)*g(9))-g(3)*(21*g(5)^2*g(6)+9*g(2)*g(7)^2-16*g(2)*g(6)*g(8)+2*g(1)*g(7)*g(8)+8*g(2)*g(5)*g(9)-2*g(1)*g(6)*g(9))+g(2)*(6*g(5)*g(6)^2+3*g(5)^2*g(7)-2*g(1)*g(8)^2+2*g(1)*g(7)*g(9)));
    c2=6*g(3)^3*(15*g(6)^2-13*g(5)*g(7)+4*g(4)*g(8))-9*g(3)^4*g(9)+3*g(3)^2*(25*g(5)^3+8*g(4)^2*g(7)-28*g(2)*g(6)*g(7)+5*g(1)*g(7)^2-8*g(1)*g(6)*g(8)+8*g(2)*g(4)*g(9)+4*g(5)*(-12*g(4)*g(6)+4*g(2)*g(8)+g(1)*g(9)))+g(1)^2*(6*g(6)^2*g(7)-9*g(5)*g(7)^2+12*g(4)*g(7)*g(8)+7*g(5)^2*g(9)-4*g(6)*(g(5)*g(8)+3*g(4)*g(9)))+2*g(3)*(24*g(4)^3*g(6)-30*g(2)*g(5)^2*g(6)+g(4)*(g(2)*(-6*g(6)^2+92*g(5)*g(7))+4*g(1)*(3*g(6)*g(7)-g(5)*g(8)))-g(4)^2*(15*g(5)^2+44*g(2)*g(8)+6*g(1)*g(9))+3*g(2)^2*(7*g(7)^2-2*g(6)*g(8)-5*g(5)*g(9))+g(1)*(-3*g(5)*g(6)^2-2*g(5)^2*g(7)-3*g(1)*g(8)^2+3*g(1)*g(7)*g(9)))+4*g(2)*(-6*g(4)^3*g(7)+g(2)*g(4)*(-7*g(6)*g(7)+9*g(5)*g(8))+g(4)^2*(3*g(5)*g(6)+g(2)*g(9))+3*g(2)*(4*g(5)*g(6)^2-5*g(5)^2*g(7)+g(2)*(-g(7)*g(8)+g(6)*g(9))))+g(1)*(-15*g(5)^4-18*g(4)^2*g(6)^2+24*g(4)^3*g(8)+12*g(5)^2*(4*g(4)*g(6)-3*g(2)*g(8))+8*g(2)*g(4)*(-6*g(7)^2+5*g(6)*g(8))+4*g(5)*(-9*g(4)^2*g(7)+19*g(2)*g(6)*g(7)+g(2)*g(4)*g(9))+6*g(2)*(-6*g(6)^3+g(2)*(g(8)^2-g(7)*g(9))));
    c3=240*g(3)^4*g(7)-12*g(3)^3*(5*(g(5)^2+8*g(4)*g(6)+2*g(2)*g(8))+g(1)*g(9))+6*g(3)^2*(80*g(4)^2*g(5)+78*g(2)*g(5)*g(6)+g(1)*(15*g(6)^2-28*g(5)*g(7))+12*g(4)*(-5*g(2)*g(7)+g(1)*g(8))+6*g(2)^2*g(9))+24*g(2)^3*(g(5)*g(8)-2*g(4)*g(9))+2*g(2)^2*(150*g(5)^3+64*g(4)^2*g(7)+15*g(1)*(3*g(7)^2-4*g(6)*g(8))+6*g(5)*(-38*g(4)*g(6)+3*g(1)*g(9)))-2*g(3)*(80*g(4)^4+42*g(2)^2*g(5)*g(7)-44*g(4)^2*(6*g(2)*g(6)+g(1)*g(7))+g(4)*(330*g(2)*g(5)^2+60*g(1)*g(5)*g(6)-72*g(2)^2*g(8))-15*g(1)*(3*g(5)^3-4*g(2)*g(6)*g(7)+4*g(2)*g(5)*g(8))+3*g(1)^2*(8*g(7)^2-18*g(6)*g(8)+11*g(5)*g(9)))+4*g(2)*(20*g(4)^3*g(5)+10*g(1)*g(4)*(3*g(6)^2+5*g(5)*g(7))-44*g(1)*g(4)^2*g(8)+3*g(1)*(-13*g(5)^2*g(6)+g(1)*(-g(7)*g(8)+g(6)*g(9))))-2*g(1)*(32*g(4)^3*g(6)+2*g(1)*g(4)*(5*g(6)*g(7)+11*g(5)*g(8))-g(4)^2*(15*g(5)^2+22*g(1)*g(9))+g(1)*(-13*g(5)^2*g(7)+g(1)*(-g(8)^2+g(7)*g(9))));
    c4=2*(-360*g(3)^4*g(5)+48*g(3)^3*(5*g(4)^2+3*g(2)*g(6)+g(1)*g(7))+2*g(1)*(50*g(4)^4+84*g(2)*g(4)^2*g(6)+3*g(2)^2*(45*g(6)^2-88*g(5)*g(7))+12*g(2)*g(4)*(-5*g(5)^2+11*g(2)*g(8)))-4*g(1)^2*(15*g(5)^3+35*g(4)^2*g(7)-3*g(2)*g(6)*g(7)-6*g(5)*(7*g(4)*g(6)+g(2)*g(8))+12*g(2)*g(4)*g(9))+g(1)^3*(13*g(7)^2-24*g(6)*g(8)+12*g(5)*g(9))+9*g(3)^2*(8*g(2)^2*g(7)+g(2)*(80*g(4)*g(5)-8*g(1)*g(8))+g(1)*(15*g(5)^2-16*g(4)*g(6)+6*g(1)*g(9)))-6*g(3)*(4*g(2)*(20*g(4)^3-3*g(1)*g(5)*g(6)-g(1)*g(4)*g(7))+12*g(2)^3*g(8)+g(1)*(30*g(4)^2*g(5)+51*g(1)*g(6)^2-69*g(1)*g(5)*g(7)+20*g(1)*g(4)*g(8))+g(2)^2*(45*g(5)^2+72*g(4)*g(6)+6*g(1)*g(9)))+6*g(2)^2*(40*g(4)^2*g(5)+12*g(2)*g(4)*g(7)+3*g(2)*(6*g(5)*g(6)+g(2)*g(9))));
    c5=-12*(-72*g(3)^5+30*g(3)^3*(8*g(2)*g(4)+g(1)*g(5))+6*g(1)*g(3)^2*(-10*g(4)^2-6*g(2)*g(6)+23*g(1)*g(7))+24*g(2)^3*(5*g(4)*g(5)+g(2)*g(7))+g(1)^3*(-27*g(6)^2+38*g(5)*g(7)-12*g(4)*g(8))+g(1)*g(2)*(80*g(4)^3+384*g(2)*g(4)*g(6)+3*g(2)*(-95*g(5)^2+8*g(2)*g(8)))-6*g(3)*(12*g(2)^3*g(6)+g(2)^2*(40*g(4)^2+22*g(1)*g(7))+2*g(1)^2*g(2)*g(8)-g(1)^2*(30*g(5)^2-44*g(4)*g(6)+g(1)*g(9)))-2*g(1)^2*(10*g(4)^2*g(5)+34*g(2)*g(4)*g(7)+3*g(2)*(-7*g(5)*g(6)+g(2)*g(9))));
    c6=12*(120*g(2)^4*g(5)+g(2)^3*(-240*g(3)*g(4)+264*g(1)*g(6))+12*g(2)^2*(10*g(3)^3-75*g(1)*g(3)*g(5)+g(1)*(60*g(4)^2-7*g(1)*g(7)))-8*g(1)^2*g(2)*(15*g(4)*g(5)+18*g(3)*g(6)+g(1)*g(8))+g(1)*(-30*g(3)^4+720*g(1)*g(3)^2*g(5)+16*g(1)*g(3)*(-30*g(4)^2+7*g(1)*g(7))+g(1)^2*(125*g(5)^2-176*g(4)*g(6)+g(1)*g(9))));
    c7=-240*g(1)*(48*g(2)^3*g(4)-18*g(2)^2*(2*g(3)^2+g(1)*g(5))-6*g(1)*g(2)*(6*g(3)*g(4)+g(1)*g(6))+g(1)*(30*g(3)^3+33*g(1)*g(3)*g(5)+g(1)*(-16*g(4)^2+g(1)*g(7))));
    c8=1440*g(1)*(3*g(2)^4-6*g(1)*g(2)^2*g(3)-4*g(1)^2*g(2)*g(4)+g(1)^2*(6*g(3)^2+g(1)*g(5)));
    c9=-2880*g(1)^3*(-g(2)^2+g(1)*g(3));
    c10=288*g(1)^5;

    r=roots([c10;c9;c8;c7;c6;c5;c4;c3;c2;c1;c0]);
    r=r(imag(r)==0);
    r1=r(r>0);
    %This shouldn't be empty unless there are finite precision error and
    %rather bad distributions. This is just an ad-hoc fix for very bad
    %scenarios.
    if(isempty(r1))
        r1=abs(r);
    end
    r=min(r1);
